import './Header.css'
import React from 'react';
import { Link } from 'react-router-dom';
import Logo from "../Logo/Logo.js";
import RoundButton from "../RoundButton/RoundButton.js";
import Burger from '../Burger/Burger.js'
import icon from "../../resources/images/easyauction_logo.png"
import zeroTo60s from "../../resources/svgs/iconZeroTo60s.svg"

import { slide as Menu } from 'react-burger-menu';

function Header() {



  return (
    <>
        <div className='header'>
            <Link className="header-logo" to={"/"}><img src={icon} /></Link>
            <img src={zeroTo60s}></img>
            <div className="header-burger">

                <Burger >
                    <div>

                        <div className="header-top">
                            <Link to="signup"><a>Sign Up</a></Link>
                            <Link to="login"><a>Login</a></Link>
                            <Link href="google.com">Contact Us</Link>
                        </div>
                        <div className='header-line'/>
                        <div className="header-bottom">
                            <Link to="howtobuy"><a>HOW TO BUY</a></Link>
                            <Link to="howtosell"><a>HOW TO SELL</a></Link>
                            <Link to="faq">HELP/FAQ</Link>
                            <RoundButton 
                                text={"Sell Now"}
                            />
                        </div>
                    </div>
                </Burger>
            </div>
        </div>
    </>
  );
}

export default Header;
